import './App.css';
import Navbar from './components/Navbar';
import ImageList from './components/ImageList';
import { getImages } from './utils/imageService';


function App() {
  getImages();
  return (
    <div className="App">
      <header className="App-header">
        <Navbar />
        <ImageList />
      </header>
    </div>
  );
}

export default App;
